webpackJsonp([0x954e9368f626],{492:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Пятиминутка React",author:"Пятиминутка React"}},markdownRemark:{id:"/Users/petr/www/5minreact.ru/src/pages/50-yasubbotnik-11-aug-2018/index.md absPath of file >>> MarkdownRemark",html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/531220989&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>11 август 2018 года в офисе Яндекса в Санкт-Петербурге прошел “Я.Субботник по разработке интерфейсов” и я там был! А после мероприятия мы с Андреем Мелиховым (ведущим подкастов Девшахта и Ночной фронтенд) обсудили доклады, послушайте, и, возможно, найдёте интересные темы для себя. Видео самих докладов уже доступны на официальной странице встречи.</p>\n<ul>\n<li><a href="https://events.yandex.ru/events/yasubbotnik/11-aug-2018/">https://events.yandex.ru/events/yasubbotnik/11-aug-2018/</a></li>\n<li><a href="https://soundcloud.com/devschacht">https://soundcloud.com/devschacht</a> - подкасты ДевШахта и Ночной фронтенд</li>\n</ul>',frontmatter:{title:"#50 - Я.Субботник по разработке интерфейсов, 11 авг 2018",date:"November 17, 2018",featuredImage:null}}},pathContext:{slug:"/50-yasubbotnik-11-aug-2018/",previous:{fields:{slug:"/49-bem-react-core/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/528262383&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>bem-react-core - библиотека (даже три), которая помогает создавать React компоненты по БЭМ методологии. В гостях Владимир Гриненко из Яндекса (<a href="https://twitter.com/tadatuta">https://twitter.com/tadatuta</a>) - все детали о свежем релизе v3 из первых уст!</p>\n<ul>\n<li><a href="https://github.com/bem/bem-react-core/tree/v3">https://github.com/bem/bem-react-core/tree/v3</a></li>\n<li><a href="https://ru.bem.info/">https://ru.bem.info/</a></li>\n<li><a href="https://www.youtube.com/watch?v=pVzlkCidOYg">https://www.youtube.com/watch?v=pVzlkCidOYg</a> скринкаст про bem-react-core v3</li>\n</ul>',excerpt:"bem-react-core - библиотека (даже три), которая помогает создавать React компоненты по БЭМ методологии. В гостях Владимир Гриненко из…",frontmatter:{title:"#49 - bem-react-core",date:"November 11, 2018",featuredImage:null}},next:{fields:{slug:"/51-vuejs-18-facts-in-2018/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/547870932&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Этот выпуск является фрагментом подкаста RadioJS, в котором я рассказал свой недавний опыт работы с Vue.js и сделал небольшое сравнение по ощущениям с React.</p>\n<p>Рекомендую также послушать весь оригинальный RadioJS Выпуск 54: Предновогодний. Svelte, Vue, новости и тренды.</p>\n<ul>\n<li><a href="https://radiojs.ru/2018/12/radiojs-54/">https://radiojs.ru/2018/12/radiojs-54/</a></li>\n<li><a href="https://youtu.be/FFZfmIQ9I44">https://youtu.be/FFZfmIQ9I44</a> - VueJS: Аргументы “за” (Илья Климов)</li>\n<li><a href="https://youtu.be/kuHSJNxNFQw">https://youtu.be/kuHSJNxNFQw</a> - VueJS: аргументы “против” (Илья Климов)</li>\n<li><a href="https://soundcloud.com/frontend-weekend/fw-83">https://soundcloud.com/frontend-weekend/fw-83</a> - Илья Климов в подкасте Forntend Weekend, рассказывает про своё разочарование во Vue.js</li>\n</ul>',excerpt:"Этот выпуск является фрагментом подкаста RadioJS, в котором я рассказал свой недавний опыт работы с Vue.js и сделал небольшое сравнение по…",frontmatter:{title:"#51 - 18 фактов о Vue.js по итогам 2018 года",date:"December 20, 2018",featuredImage:null}}}}}});
